import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation item to be visible and click it
    await page.waitForSelector('.nav-item[data-page="history"]', { timeout: 5000 });
    await page.click('.nav-item[data-page="history"]');

    // Wait for the History page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot after navigating to History
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_history.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_history.png'));

    return {
      success: true,
      action: "Clicked on the History navigation menu item in the sidebar to view watch history.",
      extractedData: {
        url: page.url(),
        title: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
